import React from 'react';
import { Link } from 'react-router-dom';
import fnlLogo from './fnl-logo.png';

function Navbar() {
    return (
        <nav
            style={{
                display: 'flex',
                justifyContent: 'space-between',
                alignItems: 'center',
                padding: '1rem',
                backgroundColor: '#007BFF',
                color: 'white',
                fontFamily: 'Arial, sans-serif',
            }}
        >
            <div style={{ display: 'flex', alignItems: 'center' }}>
                <img src={fnlLogo} alt='FNL Logo' style={{ height: '2rem', marginRight: '1rem' }} />
                <h1 style={{ margin: 0 }}>FNL</h1>
            </div>
            <div>
                <Link to='/' style={{ textDecoration: 'none', color: 'white', fontSize: '1.2rem', marginRight: '1rem' }}>
                    Home
                </Link>
                <Link to='/Game' style={{ textDecoration: 'none', color: 'white', fontSize: '1.2rem' }}>
                    Game
                </Link>
            </div>
        </nav>
    );
}

export default Navbar;
